			var optionA = document.getElementsByTagName('label')[2]; 
			optionA.innerHTML = mapping_image_options[imageID][0];
			document.getElementById('A').value = mapping_image_options[imageID][0];

			var optionB = document.getElementsByTagName('label')[3]; 
