	{
		// var response = document.getElementById("response").value;
	    // document.getElementById("response").value = "";
		var choose_response="";
		var object_response = "";

		if (document.getElementById('machine').checked) {
			choose_response = document.getElementById('machine').value;
		}
		else if(document.getElementById('human').checked) {
			choose_response = document.getElementById('human').value;
		}
		document.getElementById("machine").checked = false;
		document.getElementById("human").checked = false;

		if (document.getElementById('A').checked) {
			// later we want to set options based on imageid , create key value pair
			object_response = document.getElementById('A').value;
		}
		else if(document.getElementById('B').checked) {
			object_response = document.getElementById('B').value;
		}
		else if(document.getElementById('C').checked) {
			object_response = document.getElementById('B').value;
		}
		document.getElementById("A").checked = false;
		document.getElementById("B").checked = false;
		document.getElementById("C").checked = false;

		if (choose_response.length>0 && object_response.length>0)
		{
			//document.getElementById("demo").innerHTML = response;
			var rt = new Date().getTime() - wordon;

			psiTurk.recordTrialData({'phase':"TEST",
	                                 'imageID':imageID, //image name presented                                
									 'choose response': choose_response,
									 'object response': object_response,
	                                 'hit':imagenum[trialindex], //index of image name
	                                 'rt':rt, //response time
	                             	 'trial': trialindex+1} //trial index starting from 1
	                               );

		    next();
		}
	    else
	    {

	    	window.alert("Warning: Please choose a response for each question before submitting!");
	    }

	}
